import React, { Component } from "react";
import BaseLayout from "../components/layouts/BaseLayout";

export default class Blogs extends Component {
  render() {
    return (
      <BaseLayout>
        <h1>Blogs Page</h1>
      </BaseLayout>
    );
  }
}
